1.body:
In order to build a web app in Rust you need an HTTP server, and an async runtime. After running cargo new --bin web-app add the following lines to your Cargo.toml file: # Example, use the version numbers you need
tide = "0.15.0"
async-std = { version = "1.6.5", features = ["attributes"] }

14.body:
Another way of passing parameters in an HTTP request is in the query string. The query string follows the url and consists of a set of key and value pairs. A question mark signals the start of the query string. The key-value pairs are separated by & signs and the keys and values are separated by an equils sign. http://www.example.com/query?value1=my_value&value2=32 Tide allows you to parse the keys and values of the query string in your URL into a structure, it uses the serde-qs crate for this. To do this you first need to define a struct to receive the values from the query string; #[derive(Deserialize)]
struct Query { pub parameter1: String, pub parameter2: i32,
} Note that this struct derives serde::Deserialize to enable parsing query strings into it. You can then use the query() method on the request to parse the query string from the URL into this struct like in the following endpoint; async fn query_params(request: Request<()>) -> tide::Result { let query: Query = request.query()?; Ok(format!( "Hello, the query parameters were {} and {}", query.parameter1, query.parameter2, ) .into())
} One trick you can use when you don't want to define a whole new type to receive your query string values, Or when you don't know what keys will be present in your query string, is to parse your query-string into a HashMap<String, String> like this; async fn simple_query(request: Request<()>) -> tide::Result { let query: HashMap<String, String> = request.query()?; Ok(format!( "Hello, the query parameters were {} and {}", query["parameter1"], query["parameter2"], ) .into())
}

