To set up our application state we first need to have a type to store the application data that will be shared between requests. #[derive(Clone)]
struct AppState { pub datastore: Arc<AtomicU32>,
} In this example we will share a simple counter. We use an Arc to make sure we can safely share this even when simultanious requests come in. To set the state in the tide::server we need to use a different constructor than the server::new() we used previously. We can use server::with_state(...) to set up a server with state. let mut app = tide::with_state(AppState { datastore: Arc::new(AtomicU32::new(0)), });

2.body:
Create an HTTP server that receives a JSON body, validates it, and responds with a confirmation message. use tide::prelude::*;
use tide::Request; #[derive(Debug, Deserialize)]
struct Animal { name: String, legs: u8,
} #[async_std::main]
async fn main() -> tide::Result<()> { tide::log::start(); let mut app = tide::new(); app.at("/orders/shoes").post(order_shoes); app.listen("127.0.0.1:8080").await?; Ok(())
} async fn order_shoes(mut req: Request<()>) -> tide::Result { let Animal { name, legs } = req.body_json().await?; Ok(format!("Hello, {}! I've put in an order for {} shoes", name, legs).into())
} $ curl localhost:8080/orders/shoes -d '{ "name": "Chashu", "legs": 4 }'
Hello, Chashu! I've put in an order for 4 shoes Let's try now with an invalid number of legs ( Note that we use the -v flag to use curl in verbose mode). $ curl -v localhost:8080/orders/shoes -d '{ "name": "Mary Millipede", "legs": 750 }'
< HTTP/1.1 422 Unprocessable Entity
< content-length: 0
< date: Fri, 26 Feb 2021 13:31:17 GMT We get an http error, 422 to be more specific, and that is because we are using the body_json method to deseriaize the body into the Animal struct and the legs fields type is u8. We will cover body_json and the other available methods for deserialize the body in the Request/Response chapter .

