The state can then be accessed using the state method on your Request inside your endpoints; async fn read_state(request: Request<AppState>) -> tide::Result { Ok(format!( "datastore has been updated {} times", request.state().datastore.load(Ordering::SeqCst) ) .into())
} async fn update_state(request: Request<AppState>) -> tide::Result { request.state().datastore.fetch_add(1, Ordering::SeqCst); Ok("datastore updated".into())
}

4.body:
A basic Tide Server is constructed with tide::new(). #[async_std::main]
async fn main() -> tide::Result<()> { let server = tide::new(); Ok(())
} The server can then be started using the asynchronous listen method. #[async_std::main]
async fn main() -> tide::Result<()> { let server = tide::new(); server.listen("127.0.0.1:8080").await?; Ok(())
} While this is the simpelest Tide application that you can build, it is not very useful. It will return a 404 HTTP response to any request. To be able to return anything useful we will need to handle requests using one or more Endpoints

5.body:
To make the Server return anything other than an HTTP 404 reply we need to tell it how to react to requests. We do this by adding one or more Endpoints; #[async_std::main]
async fn main() -> tide::Result<()> { let mut server = tide::new(); server.at("*").get(|_| async { Ok("Hello, world!") }); server.listen("127.0.0.1:8080").await?; Ok(())
} We use the at method to specify the route to the endpoint. We will talk about routes later. For now we'll just use the "*" wildcard route that matches anything we throw at it. For this example we will add an async closure as the Endpoint. Tide expects something that implements the Endpoint trait here. But this closure will work because Tide implements the Endpoint trait for certain async functions with a signature that looks like this; async fn endpoint(request: tide::Request) -> tide::Result<impl Into<Response>> In this case Into<Response> is implemented for &str so our closure is a valid Endpoint. Because Into<Response> is implemented for several other types you can quickly set up endpoints. For example the next endpoint uses the json! macro provided by use tide::prelude::* to return a serde_json::Value. use tide::prelude::*;
#[async_std::main]
async fn main() -> tide::Result<()> { let mut server = tide::new(); server.at("*").get(|_| async { Ok(json!({ "meta": { "count": 2 }, "animals": [ { "type": "cat", "name": "chashu" }, { "type": "cat", "name": "nori" } ] })) }); server.listen("127.0.0.1:8080").await?; Ok(())
} Returning quick string or json results is nice for getting a working endpoint quickly. But for more control a full Response struct can be returned. server.at("*").get(|_| async { Ok(Response::new(StatusCode::Ok).set_body("Hello world".into()))
}); The Response type is described in more detail in the next chapter. More than one endpoint can be added by chaining methods. For example if we want to reply to a delete request as well as a get request endpoints can be added for both; server.at("*") .get(|_| async { Ok("Hello, world!") }) .delete(|_| async { Ok("Goodbye, cruel world!") }); Eventually, especially when our endpoint methods grow a bit, the route definitions will get a crowded. We could move our endpoint implementations to their own functions; #[async_std::main]
async fn main() -> tide::Result<()> { let mut server = tide::new(); server.at("*").get(endpoint); server.listen("127.0.0.1:8080").await?; Ok(())
} async fn endpoint(_req: tide::Request<()>) -> Result<Response> { Ok(Response::new(StatusCode::Ok).set_body("Hello world".into()))
}

6.body:
The server we built is still not very useful. It will return the same response for any URL. It is only able to differentiate between requests by HTTP method. We already used the .at method of the Server to define a wildcard route. You might have guessed how to add endpoints to specific routes; #[async_std::main]
async fn main() -> tide::Result<()> { let mut server = tide::new(); server.at("/hello").get(|_| async { Ok("Hello, world!") }); server.at("/bye").get(|_| async { Ok("Bye, world!") }); server.listen("127.0.0.1:8080").await?; Ok(())
} Here we added two routes for two different endpoints. Routes can also be composed by chaining the .at method. server.at("/hello").at("world").get(|_| async { Ok("Hello, world!") }); This will give you the same result as: server.at("/hello/world").get(|_| async { Ok("Hello, world!") }); We can store the partial routes and re-use them; #[async_std::main]
async fn main() -> tide::Result<()> { let mut server = tide::new(); let hello_route = server.at("/hello"); hello_route.get(|_| async { Ok("Hi!") }); hello_route.at("world").get(|_| async { Ok("Hello, world!") }); hello_route.at("mum").get(|_| async { Ok("Hi, mum!") }); server.listen("127.0.0.1:8080").await?; Ok(())
} Here we added two sub-routes to the hello route. One at /hello/world and another one at hello/mum with different endpoint functions. We also added an endpoint at /hello. This gives an idea what it will be like to build up more complex routing trees When you have a complex api this also allows you to define different pieces of your route tree in separate functions. #[async_std::main]
async fn main() -> tide::Result<()> { let mut server = tide::new(); set_v1_routes(server.at("/api/v1")); set_v2_routes(server.at("/api/v2")); server.listen("127.0.0.1:8080").await?; Ok(())
} fn set_v1_routes(route: Route) { route.at("version").get(|_| async { Ok("Version one") });
} fn set_v2_routes(route: Route) { route.at("version").get(|_| async { Ok("Version two") });
} This example shows for example an API that exposes two different versions. The routes for each version are defined in a separate function.
